import React from "react";
import Items from './items';
import { products } from './products';


function App2() {

    return (
        <div className="">
            {
                products.map((curItem) =>{
                   return <Items  key={curItem.product_id} {...curItem}/>
                })
            }
         
        </div>
    )

}


export default App2;
